This week’s Courage story is from @randiiiiiii She’s totally rad and part of the sweet podcasting group I’m lucky enough to mentor! Check her out!!

Courage has been embracing who I am and owning what we'll call my most "non-traditionally marketable" strength as one of my biggest; empathy. In many ways I was taught that sensitivity was weakness and being called "sensitive" was an insult. I'd be lying if I said that it wasn't more than a little frustrating to grow up feeling like one of my most dominant characteristic traits was seen as an epic flaw. Let's just say that if I had a nickel for every time I’ve heard, “you care too much,” poverty would not exist.

It wasn't until much later that I realized empathy is actually a superpower, and it was not until recently that I'd heard that acknowledged by others. Glennon Doyle once said it so succinctly in a tweet, "I'm the canary in the mine. My sensitivity could save us all."

So, instead of heeding advice to give fewer f*cks, I couraged up, doubled down, and decided to start a podcast called "You Care Too Much." @youcaretoomuchpod The podcast is dedicated to elevating the voices and telling the stories of purpose-drivers, social entrepreneurs, world-changers, and all those who reject the status quo, advocate for, and create things that better the lives of many. Courage to me has been giving a f*ck even when it feels like no one else does. Courage is creating the thing that I'd once needed; a space that sees strength in empathy and understands that strength holds the power to change the world.

