It's ok to be inspired by another, but if watching someone else achieve success makes you feel bad about yourself, stop torturing yourself. 

Step 1 ) Unfollow them

Step 2) Focus more on you and less on everybody else. Spend less time scrolling and more time making positive changes.  And by all means, don't focus on the result, focus on the work. 

Did you work out today?  Yes
Do you look any better?  No
Do you feel better?  Probably
Will the result of consistent hard work show after some time?  Yes!!

Your journey is where you'll find the happiness and success you are looking for. 

So, what do you envision for your life?  What is a goal you'd like to accomplish?

If you start working towards that dream or that goal, my hope for you is that someday you'll be so damn happy and successful that someone ends up having to unfollow you. 

Now get to it! 

