✨
I think it’s safe to say that 2020 has been an incredibly uncertain/emotional/bizarre/“insert adjective of choice” year for all of us ... between a global pandemic and a country (rightfully) filled with civil unrest, it’s no surprise that Google searches for anxiety-related terms have reached record highs. 
✨
For me, being unemployed this entire year has added another layer of uncertainty as well. I’ve had a full-time job since I graduated from college so not working for the last 9 months has been interesting to say the least — both emotionally and financially.
✨
Having said all that, my husband and I recently had a talk about the silver linings that have shown themselves throughout this year ... giving us a glimpse that, yes, one day everything we’ve gone through in 2020 truly will make sense.
✨
Personally, we’ve both learned that we don’t need nearly as much as we thought we did to be happy ... and we’ve realized that being able to pursue our dream jobs — even if they pay less than what we’re used to — is an opportunity we don’t want to pass up. Stay tuned for more on that from me soon [insert winking emoji here].
✨
So, my friends ... what are some of the positive lessons you’ve learned throughout this oddly strange year? Leave me a comment, and share it with the world!

